const path = require('path');
const archiver = require('archiver');

// --input \u8F38\u5165\u76EE\u9304\u3002\u76F8\u5C0D\u8DEF\u5F91\u65BC workspace\u3002\u9810\u8A2D\u70BA dist\u3002

let check = true; // \u6AA2\u67E5\u662F\u5426\u53EF\u4EE5\u9032\u884C\u58D3\u7E2E
const workspace = process.cwd(); // \u5DE5\u4F5C\u76EE\u9304
let input = 'dist';

const argvs = {};
process.argv.forEach(
  (prgvItem) => {
    if (prgvItem.startsWith('--') && prgvItem.indexOf('=') !== -1) {
      const argvKey = prgvItem.substring(2, prgvItem.indexOf('='));
      const argvValue = prgvItem.substring(prgvItem.indexOf('=') + 1, prgvItem.length);
      argvs[argvKey] = argvValue;
    }
  }
);

if (argvs['input']) {
  input = argvs['input'];
}
input = path.join(workspace, input);

if (!fs.existsSync(input)) {
  check = false;
  console.log(input, '\u4E0D\u5B58\u5728');
}

if (check) {
  zipDir();
}

function zipDir() {
  const tmpPath = path.join(workspace, 'tmp');
  if (!fs.existsSync(tmpPath)) {
    fs.mkdirSync(tmpPath);
  }
  const outputFile = path.join(tmpPath, path.basename(input) + '.zip');
  // create a file to stream archive data to.
  const output = fs.createWriteStream(outputFile);
  const archiveZip = archiver('zip');

  // listen for all archive data to be written
  // 'close' event is fired only when a file descriptor is involved
  output.on('close', function () {
    console.log('output file:', outputFile);
    if (archiveZip.pointer() <= 22) {
      console.log('\u8ACB\u6AA2\u67E5 zip \u5167\u5BB9');
    }
    console.log(archiveZip.pointer() + ' total bytes');
  });

  // This event is fired when the data source is drained no matter what was the data source.
  // It is not part of this library but rather from the NodeJS Stream API.
  // @see: https://nodejs.org/api/stream.html#stream_event_end
  output.on('end', function () {
    console.log('Data has been drained');
  });

  // good practice to catch warnings (ie stat failures and other non-blocking errors)
  archiveZip.on('warning', function (err) {
    if (err.code === 'ENOENT') {
      // log warning
      console.warn(err);
    } else {
      // throw error
      throw err;
    }
  });

  // good practice to catch this error explicitly
  archiveZip.on('error', function (err) {
    throw err;
  });

  // pipe archive data to the file
  archiveZip.pipe(output);

  // append files from a sub-directory, putting its contents at the root of archive
  archiveZip.directory(input, false);

  // finalize the archive (ie we are done appending files but streams have to finish yet)
  // 'close', 'end' or 'finish' may be fired right after calling this method so register to them beforehand
  archiveZip.finalize();
}
